import React from "react";
import "./App.css";
import { Home, Navbar } from "./components";
import { BrowserRouter as Router, Route, Link, Routes } from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <div className="app">
            <Navbar />
          <Route exact path="/" element={Home} />
          <Route path="/checkout">
            <h1>HELLLOOOO</h1>
          </Route>
          <Route path="/">
            <Navbar />
            <Home />
          </Route>
        </div>
      </Routes>
    </Router>
  );
}

export default App;
